import React from "react";

export default function ComboBox({contents}) {
  return (
    <div>
      <select className=" text-sm h-6 border" name="month">
        {contents.map((data)=>
            <option value={data.value}>{data.face}</option>   
        )}
      </select>
    </div>
  );
}
